import React, { useState } from "react";
import {MultiSelect} from "react-multi-select-component";
import Form from "./Form";

function SelectReason() {
  const options = [
    { label: "Register to Raise Fund", value: "Register TO Raise Fund" },
    {
      label: "Raise Fund As Organization",
      value: "raise fund as organization"
    },

   
    { label: "Others", value: "others" }
  ];

  const [selected, setSelected] = useState([]);
  const [disabled, setdisabled] = useState(false);
  return (
    <div className="form__row">
      <span>Please Select Your Reason for Registration/Role of Particcpation:</span>
      <MultiSelect
        options={options}
        value={selected}
        onChange={setSelected}
        labelledBy={"Select Your Reason for Registration"}
        className={"selectAll"}
      />
    </div>
  );
}

export default SelectReason;
